package com.找到字符串中所有字母异位词;
import java.sql.SQLOutput;
import java.util.*;
public class Main {
    public static void main(String[] args) {
        String s = "";
        String p = "";
        System.out.println(new Solution().findAnagrams(s, p));
        int a = 1000000000;
    }
}

class Solution {
    public List<Integer> findAnagrams(String s, String p) {
        Map<Character, Integer> tar = new HashMap<>(), cur = new HashMap<>();
        int n = p.length();
        if(s.length() < n){
            return new LinkedList<Integer>();
        }

        System.out.println(s.length() + " " + n);
        for(char c: p.toCharArray()){
            int val = tar.getOrDefault(c, 0)+1;
            tar.put(c, val);
        }
        for(int i=0; i<n; i++){
            Character key = s.charAt(i);
            int val = cur.getOrDefault(key, 0)+1;
            cur.put(key, val);
        }
        List<Integer> res = new LinkedList<>();
        if(check(cur, tar)){
            res.add(0);
        }
        for(int r=n; r<s.length(); r++){
            int l = r-n;
            char addChar = s.charAt(r);
            char delChar = s.charAt(l);
            if(delChar != addChar){
                cur.put(addChar, cur.getOrDefault(addChar, 0) +1);
                cur.put(delChar, cur.get(delChar) - 1);
            }
            if(check(cur, tar)){
                res.add(l+1);
            }
        }
        return res;


    }

    private boolean check(Map<Character, Integer>cur, Map<Character, Integer>tar){
        for(Map.Entry<Character, Integer> entry : tar.entrySet()){
            Character key = entry.getKey();
            System.out.println(cur.get(key));
            System.out.println(entry.getValue());
            if(!cur.get(key).equals(entry.getValue())){
                return false;
            }
        }
        return true;
    }
}